  const [canales, setCanales] = useState();

  //Funcion getData crea la llamada a la URL de ApiChannel

  const getData = async () => {
    const response = await fetch("http://localhost:5001/api/channels");
    const result = await response.json();
    setCanales(result);
    console.log(result)     
}

//Utilizamos el metodo de useEffect para para hacer la llamada, q
    useEffect(() => {
      getData()
    },[]);

  return (
    <div>
        <h1>Listado</h1>
        <ul>
        {!canales
         ? 
         'Cargando data...'
         :
        canales.map((canal, index) =>{
            return <li key={index}>{canal.nombre}</li>
        })
        }
        </ul>
    </div>
  );
}


